use rand::{Rng, SeedableRng};
use rand_chacha::ChaCha8Rng;

use crate::cnf::{AlgoResult, Formula, get_random_bool_values};

const MAX_TRIES: usize = 1;
const MAX_FLIPS: usize = 300;

pub fn gsat(formula: Formula, p: f64, seed: u64) -> AlgoResult {
    let mut rng = ChaCha8Rng::seed_from_u64(seed);
    let mut result = AlgoResult {
        iterations: 0,
        solution: None,
        count_of_clauses: formula.number_of_clauses,
        count_of_satisfied_clauses: 0,
    };

    for _ in 0..MAX_TRIES {
        let mut values = get_random_bool_values(formula.number_of_literals, &mut rng);
        for _ in 0..MAX_FLIPS {
            if formula.solve_with(&values) {
                result.solution = Some(values);
                result.count_of_satisfied_clauses = formula.number_of_clauses;
                return result;
            }

            let chosen_var = if rng.random_bool(p) {
                let unsatisfied_clause = formula.random_unsatisfied_clause(&values, &mut rng);
                unsatisfied_clause.random_variable(&mut rng)
            } else {
                let original_satisfied_count = formula.count_satisfied_clauses(&values) as i32;
                let mut changes = vec![0; values.len()];

                for i in 0..values.len() {
                    // Flip
                    values[i] = !values[i];

                    let this_satisfied_count = formula.count_satisfied_clauses(&values) as i32;
                    changes[i] = this_satisfied_count - original_satisfied_count;

                    // Flip back
                    values[i] = !values[i];
                }

                let max_change = *changes.iter().max().unwrap();
                let picks = changes
                    .into_iter()
                    .enumerate()
                    .filter_map(|(index, change)| {
                        if change == max_change {
                            Some(index)
                        } else {
                            None
                        }
                    })
                    .collect::<Vec<_>>();
                let rand_pick_index = rng.random_range(0..picks.len());

                picks[rand_pick_index]
            };

            values[chosen_var] = !values[chosen_var];

            result.iterations += 1;
        }

        result.count_of_satisfied_clauses = formula.count_satisfied_clauses(&values);
    }

    result
}

